  const {theme, toggleTheme} = useContextGlobal();

  const routes = [
    { path: '/home', name: 'Home' },
    { path: '/favs', name: 'Favs' },
    { path: '/contacto', name: 'Contact' },
  ]


  return (
    <nav className={`navbar ${theme}`}>
      <ul>
        
      </ul>
      <button onClick={toggleTheme}>Change theme</button>
    </nav>
  )
}

export default Navbar
